import React from 'react';

class Video extends React.Component {
  state = {
    que: undefined
  }
  gettingVideoId = async (e) => {
    e.preventDefault()
    const id = e.target.elements.que.value
    if (id) {
      const apiUrl = await fetch(`https://cors-anywhere.herokuapp.com/https://www.googleapis.com/youtube/v3/search?part=id&q=${que}&type=video&maxResults=50&key=AIzaSyDmMWnY0zzXyao-vIjwsFG5HPu7dVv3WK4`)
      const data = await apiUrl.json()
      console.log(data)
    }
  }

  render () {
    return (
      <div>
        <button onClick={this.gettingVideoId}>Получить</button>
      </div>
    )
  }
}

export default Video;
